val dataframe_test_complete = uc.sql("""SELECT sensorbin, 
                    double(amplitude) amplitude, data
                    FROM manutencao where data >= '2007-09-01' order by data""").repartition(5).na.drop.cache

val toBeTestedGrouped = dataframe_test_complete.rdd.map{case Row(id:Double, amp: Double, data:Timestamp) => ((id), (data.getTime, amp))}.groupByKey
val toBeTestedGroupedTS = toBeTestedGrouped.map{case (key, values) =>(key, values.toArray.sortBy(_._1).map{_._2})}
val toBeTestedByR = toBeTestedGroupedTS.map{case(a,b) => (a, b.toArray)}

val combinedRdd = predictionsRdd.join(toBeTestedByR)
val combinedRdd2 = combinedRdd.map{case(bin, ((erro_percentual, erro_medio, desvio_padrao, prediction),test)) => (bin, erro_medio, desvio_padrao, prediction.toArray, test)}
val combinedRdd3 = combinedRdd2.flatMap{case (bin, erro_medio, desvio_padrao, prediction, test) => (prediction.zip(test).zipWithIndex).map{case((a, b), index) => (bin, index, erro_medio, desvio_padrao, a,b)}  }

val combinedRdd6 = combinedRdd5.join(boundaries).map{case (bin, ((data,predicao,observado),boundary)) =>
val distancia = Math.abs(predicao-observado)
val alerta = (distancia > boundary) match {
    case true => distancia
    case false => 0.0
}
(bin,new Timestamp(data20070901 + data.toLong*oneday), predicao,observado, boundary, distancia, alerta)}
